import React, { Component } from "react";
import { Table } from "reactstrap";
import NewSongModal from "./NewSongModal";

import ConfirmRemovalModal from "./ConfirmRemovalModal";

class SongList extends Component {
  render() {
    const artists = this.props.artists;
    return (
      <Table dark>
        <thead>
          <tr>
            <th>Song</th>
            <th>Artist</th>
            <th>Album</th>
            <th>Genre</th>
            <th>Year</th>
            <th>Registration</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {!artists || artists.length <= 0 ? (
            <tr>
              <td colSpan="6" align="center">
                <b>Ops, no one here yet</b>
              </td>
            </tr>
          ) : (
            artists.map(artists => (
              <tr key={artists.pk}>
                <td>{artists.song}</td>
                <td>{artists.artist}</td>
                <td>{artists.album}</td>
                <td>{artists.genre}</td>
                <td>{artists.year}</td>
                <td>{artists.registrationDate}</td>
                <td align="center">
                  <NewSongModal
                    create={false}
                    artists={artists}
                    resetState={this.props.resetState}
                  />
                  &nbsp;&nbsp;
                  <ConfirmRemovalModal
                    pk={artists.pk}
                    resetState={this.props.resetState}
                  />
                </td>
              </tr>
            ))
          )}
        </tbody>
      </Table>
    );
  }
}

export default SongList;
